    value: We are filing this amendment in response to the FEC request for more information
      dated October 27 2004.      Item 1- This item has been clarified.    Item 2-
      The Kansas Democratic Party charged local party committees and candidates for
      access to and support for our Voter File.  We determined the value of the service
      depending on the size of the district and the level of access and support required.  The
      basis for this valuation was our cost of building the file.    Item 3- This
      item has been corrected.  The correct box has been checked.    Item 4- This
      item has been corrected.    Item 5- Please note that portions of this disbursement
      are reported as in-kind contributions on Line 23.  Transaction numbers SB23-01-01426-01924
      and SB23-01-01426-01926 are tied to SB30b-01-01426-01923.    Item 6- We have
      carefully reviewed the definitions of Federal Election Activity and this activity
      does not meet those definitions.  Therefore this expense was properly paid.     Item
      7- We utilize the standard Last in first out accounting method.     Item 8-
